import React from "react";
import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Ionicons from 'react-native-vector-icons/Ionicons';
import { StatusBar } from 'react-native';

import Produtos from './views/Produtos';
import Produto from './views/Produto';
import Card from './components/cards';
import card_comentarios from './components/card_comentarios';

const Stack = createStackNavigator();

function Descricao(){
  return(
    <Tab.Navigator>
      <Tab.Screen name="inicio" options={{title: 'Início'}} component={Produtos} />
      <Tab.Screen name="comentarios" options={{title: 'Comentários'}} component={card_comentarios} />
    </Tab.Navigator>
  );
}

export default function App() {
  return (
    <>
      <StatusBar barStyle="light-content" />
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen 
            name="Cachorros"
            component={Produtos}
            options={{ title: 'Cachorros'}}  />
          <Stack.Screen 

            name="Cachorro"
            component={Produto}
            options={{ title: 'Informações'}}  />
        </Stack.Navigator>
      </NavigationContainer>
    </>

  );
}
